CREATE TABLE IF NOT EXISTS public.municipio(
       codigo INTEGER NOT NULL
     , codigo_completo INTEGER NOT NULL
     , nome VARCHAR(255) NOT NULL
     , cod_uf VARCHAR(2) NOT NULL
     , nome_uf VARCHAR(255) NOT NULL
     , CONSTRAINT pk_municipio_codigo PRIMARY KEY (codigo_completo)
);
DO $$
BEGIN
  IF NOT (SELECT EXISTS(
     SELECT 1 FROM information_schema.columns 
      WHERE table_schema ILIKE 'public' 
        AND table_name ILIKE 'municipio' 
        AND column_name ILIKE 'sigla_uf')
  ) THEN
    DELETE FROM public.municipio;
    ALTER TABLE public.municipio ADD COLUMN sigla_uf VARCHAR(2) NOT NULL;

  END IF;
END $$;

